                              "A very nice market place which was walking distance from our hotel near Walking street.\n\nYou need to do a lot of bargaining here to get the best rates out of them or you will be guilty of spending more for a lesser value product.\n\nThe market is clean and is centrally located. They sell here replicas and look alike of most brands across all products which also include watches, leather bags, lady bags and purses, t shirts, artefacts, souvenirs, fruits, dry fruits  etc\n\nThere are also a few garment shops with fixed pricing. My advice is to shops which have fixed prices so that you get the best and not taken for a ride and you end up paying the right prices as the currency there still confuses me. I had a few US dollars and would pay by US dollars for simpler understanding and all shops accept USD here in üáªüá≥\n\nOver all a good looking building that houses the market, reasonable prices but bargaining needed, fixed prices shops advised.\n\nOverall a lovely place for everything and anything !\n\nPlease visit !\n\nStay safe, be careful while riding bikes and crossing roads to have a memorable trip !\n\nKeep üáªüá≥ clean and plastic free.",
