                         rating: 5,
                         rank: 2,
                         reviewText:
                              "Memorial to the 'burning monk'\n\nTo the side of a busy junction in Saigon (Ho Chi Minh city) sits this memorial to Th√≠ch Qu·∫£ng ƒê·ª©c, the Buddhist monk who in 1963 self-immolated in protest against the oppression and persecution of Buddhists by the then South Vietnamese Government headed by Ng√¥ ƒê√¨nh Di·ªám , who was supported by the US. Behind the statue are images of violence unleashed by the Government forces and the monk afire beside an Austin Westminster sedan, in which he travelled to the protest site. The only two journalists who were at the place when he set fire to himself accompanied by a group of monks, said that he did not move a muscle or scream out as the fires consumed him.The monk's death had major repercussions, although the repression of Buddhists didn't end that soon.\n\nThe arresting image of the burning monk was a reminder of the ongoing persecution back, using reasons ranging from NRC and citizenship bill to beef.\n\n(I first saw the iconic image of the burning monk from a 'Rage against the machine' video several years back)",
